- The trial period shall automatically convert into the equivalent subscription unless you cancel the purchase before the trial period expires.
- The payment for your subscription will be debited from your account after confirmation of your order.
- The subscription is automatically renewed at the end of the subscription period, so your bank account associated with your payment card will be debited via your iTunes account.
- You can stop the automatic renewal from your iTunes account at any time. To avoid unwanted renewal, please do so at least 24 hours before the subscription expiration date. There will be no refunds for the unused period of your subscription.

